import datetime

def is_leap_year(year):
    if year % 400 == 0:
        return True
    elif year % 100 == 0:
        return False
    elif year % 4 == 0:
        return True
    else:
        return False

def days_in_month(year, month):
    if month == 1 or month == 3 or month == 5 or month == 7 or month == 8 or month == 10 or month == 12:
        return 31
    elif month == 4 or month == 6 or month == 9 or month == 11:
        return 30
    elif is_leap_year(year) and month == 2:
        return 29
    elif not is_leap_year(year) and month == 2:
        return 28

def days_between_dates(year1, month1, day1, year2, month2, day2):
    date1 = datetime.date(year1, month1, day1)
    date2 = datetime.date(year2, month2, day2)
    delta = date2 - date1
    return delta.days

year1, month1, day1 = map(int, input().split(':'))
year2, month2, day2 = map(int, input().split(':'))
print(days_between_dates(year1, month1, day1, year2, month2, day2))
















































































































































































































































































































