import calendar
from datetime import date

def is_leap(year):
    if year % 4 == 0:
        if year % 100 == 0:
            if year % 400 == 0:
                return True
            else:
                return False
        else:
            return True
    else:
        return False

def days_in_month(year, month):
    if month in [1, 3, 5, 7, 8, 10, 12]:
        return 31
    elif month in [4, 6, 9, 11]:
        return 30
    elif is_leap(year) and month == 2:
        return 29
    else:
        return 28

def days_between_dates(start_year, start_month, start_day, end_year, end_month, end_day):
    start_date = date(start_year, start_month, start_day)
    end_date = date(end_year, end_month, end_day)
    delta = end_date - start_date
    return delta.days

if __name__ == '__main__':
    start_year, start_month, start_day = map(int, input().split(':'))
    end_year, end_month, end_day = map(int, input().split(':'))
    print(days_between_dates(start_year, start_month, start_day, end_year, end_month, end_day))
